import {Route , Switch} from "react-router-dom";
import SimpleForm from "./component/SimpleForm";
import AdvancedForm from "./component/AdvancedForm";


function App() {
  return (
    <div>
      {/* header */}
      <Switch>
            <Route exact path="/" component={SimpleForm} />
   
      </Switch>
    </div>
  );
}

export default App;
